s a strong odor on impact. Causes certain monsters to flee.',2,20,0,10,20),(64,'Smoke Bomb','Creates a large cloud of smoke wherever it lands.',2,44,0,3,44),(65,'Poison Smoke Bomb','Releases a toxic cloud of mist when used. Also popular as a household bug bomb.',2,60,0,5,60),(66,'Farcaster','Call for a wingdrake to transport you to the nearest camp. Can also be used during battles.',3,30,0,1,30),(67,'Raw Meat','Meat carved from a monster. Can be cooked, combined, or used to set a trap.',1,5,0,10,5),(68,'Poisoned Meat','Raw meat that poisons whatever eats it. Makes great bait for traps.',1,19,0,10,19),(69,'Tinged Meat','Raw meat that paralyzes whatever eats it. Makes great bait for traps.',2,30,0,10,30),(70,'Drugged Meat','Raw meat that puts whatever eats it to sleep. Makes great bait for traps.',1,32,0,10,32),(71,'Gunpowder','A dangerous substance that explodes when struct or heated.',2,45,0,20,45),(72,'Small Barrel','',1,0,0,10,8),(73,'Barrel Bomb','',2,0,0,10,16),(74,'Bounce Bomb','',2,0,0,10,18),(75,'Mega Bounce Bomb','',4,0,0,5,68),(76,'Large Barrel','A large, empty barrel. Combine with gunpowser to make it into a bomb.',2,21,0,10,21),(77,'Large Barrel Bomb','',3,0,0,3,52),(78,'Mega Barrel Bomb','An upgraded large barrel bomb. Effective against large monsters.',4,80,0,2,80),(79,'Spider Web','A very sticky web. Used to craft pitfall traps.',1,6,0,10,6),(80,'Net','A sturdy net that supports a certain amount of weight without breaking. Perfect for pitfall traps.',2,54,0,10,54),(81,'Trap Tool','A must-have item for putting together pitfall traps and other kinds of traps.',3,20,0,2,20),(82,'Pitfall Trap','A trap for catching certain large monsters. It is tripped by a heavy weight.',3,200,0,1,46),(83,'Shock Trap','A trap that immobilizes a target. Use it to capture monsters.',3,160,0,1,160),(84,'Rolled-up Dung','A ball of condensed monster dung. Used to make dung pods for your slinger.',1,10,0,20,10),(85,'Dung','Exudes a prodigious smell. Used to make ammo for your sl