INSERT INTO `skills` VALUES (1,'Poison Resistance','poison-resistance','Grants protection against the effects of poison.',3),(2,'Paralysis Resistance','paralysis-resistance','Reduces the duration of paralysis.',3),(3,'Sleep Resistance','sleep-resistance','Reduces the duration of sleep.',3),(4,'Stun Resistance','stun-resistance','Reduces stun duration.',3),(5,'Muck Resistance','muck-resistance','Reduces impairments to mobility while stuck in monster muck.',1),(6,'Blast Resistance','blast-resistance','Grants protection against blastblight.',3),(7,'Bleeding Resistance','bleeding-resistance','Grants protection against bleeding.',3),(8,'Iron Skin','iron-skin','Grants protection against Defense Down.',3),(9,'Earplugs','earplugs','Grants protection from large monsters\' roars.',5),(10,'Windproof','windproof','Grants protection against wind pressure.',5),(11,'Tremor Resistance','tremor-resistance','Grants protection against ground tremors.',3),(12,'Dungmaster','dungmaster','Makes monsters hit with slinger dung pods more likely to run.',1),(13,'Effluvial Expert','effluvial-expert','Nullifies or reduces environmental damage in the Rotten Vale.',1),(14,'Heat Guard','heat-guard','Nullifies damage from heat.',1),(15,'Attack Boost','attack-boost','Increases attack power. Also improves affinity at higher levels.',7),(16,'Defense Boost','defense-boost','Increases defense. Level up to improve resistances as well.',7),(17,'Health Boost','health-boost','Increases health.',3),(18,'Recovery Up','recovery-up','Increases the amount recovered when restoring health.',3),(19,'Recovery Speed','recovery-speed','Speeds healing of recoverable damage (the red portion of the health gauge).',3),(20,'Fire Resistance','fire-resistance','Increases fire resistance. Also improves defense at higher levels.',3),(21,'Water Resistance','water-resistance','Increases water resistance. Also improves defense at higher levels.',3),(22,'Ice Resistance','ice-resistance','Increases ice resistance. Also improves defense at higher levels.',3),(23,'Thunder Resistance','thunder-resistance','Increases thunder resistance. Also improves defense at higher levels.',3),(24,'Dragon Resistance','dragon-resistance','Increases dragon resistance. Also improves defense at higher levels.',3),(25,'Blight Resistance','blight-resistance','Grants protection against all elemental blights.',3),(26,'Fire Attack','fire-attack','Increases fire element attack power. (Elemental attack power has a maximum limit.)',5),(27,'Water Attack','water-attack','Increases water element attack power. (Elemental attack power has a maximum limit.)',5),(28,'Ice Attack','ice-attack','Increases ice element attack power. (Elemental attack power has as maximum limit.)',5),(29,'Thunder Attack','thunder-attack','Increases thunder element attack power. (Elemental attack power has a maximum limit.)',5),(30,'Dragon Attack','dragon-attack','Increases dragon element attack power. (Elemental attack power has a maximum limit.)',5),(31,'Poison Attack','poison-attack','Increases the rate of poison buildup. (Elemental buildup has a maximum limit.)',3),(32,'Paralysis Attack','paralysis-attack','Increases the rate of paralysis buildup. (Elemental buildup has a maximum limit.)',3),(33,'Sleep Attack','sleep-attack','Increases the rate of sleep buildup. (Elemental buildup has maximum limit.)',3),(34,'Blast Attack','blast-attack','Increases the rate of the blast buildup. (Elemental buildup has a maximum limit.)',3),(35,'Normal Shots','normal-shots','Increases the attack power of normal ammo and normal arrows.',1),(36,'Piercing Shots','piercing-shots','Increases the attack power of piercing ammo and Dragon Piercer.',1),(37,'Spread/Power Shots','spread/power-shots','Increases the attack power of spread ammo and power shot arrows.',1),(38,'Free Elem/Ammo Up','free-elem/ammo-up','Unlocks your weapon\'s hidden element. Also increases bowgun loading capacity. (There is a cap to loading capacity.)',3),(39,'Critical Eye','critical-eye','Increases affinity.',7),(40,'Critical Boost','critical-boost','Increases the damage of critical hits.',3),(41,'Weakness Exploit','weakness-exploit','Increases the affinity of attacks that exploit a monster weak spot.',3),(42,'Focus','focus','Increases the fill rate for weapons with gauges and the charge rate for weapons with charge attacks.',3),(43,'Power Prolonger','power-prolonger','Allows long swords, dual blades, insect glaives, switch axes, and charge blades to stay powered up longer.',3),(44,'Handicraft','handicraft','Extends the weapon sharpness gauage. However, it will not increase the gauge past its maximum.',5),(45,'Critical Draw','critical-draw','Increases affinity when performing draw attacks.',3),(46,'Partbreaker','partbreaker','Makes it easier to break or sever parts of large monsters.',3),(47,'Slugger','slugger','Makes it easier to stun monsters.',3),(48,'Stamina Thief','stamina-thief','Increases certain attacks\' ability to exhaust monsters.',3),(49,'Master Mounter','master-mounter','Makes it easier to mount monsters.',1),(50,'Airborne','airborne','Increases the damage caused by jumping attacks.',1),(51,'Latent Power','latent-power','Temporarily increases affinity and reduces stamina depletion when certain conditions are met.',5),(52,'Agitator','agitator','Increases attack power and affinity when large monsters become enraged.',5),(53,'Peak Performance','peak-performance','Increases attack when your health is full.',3),(54,'Heroics','heroics','Increases attack power and defense when health drops to 35% or lower.',5),(55,'Fortify','fortify','Increases your attack and defense every time you fall in battle. (This effect can stack twice.)',1),(56,'Resentment','resentment','Increases attack when you have recoverable damage (the red portion of your health gauge).',5),(57,'Resuscitate','resuscitate','Improves evasion and reduces stamina depletion when afflicted with abnormal status effects.',1),(58,'Horn Maestro','horn-maestro','Increases the effect duration of hunting horn melodies.',1),(59,'Capacity Boost','capacity-boost','Increases the gunlance\'s shell capacity and charge blade\'s phial capacity.',1),(60,'Special Ammo Boost','special-ammo-boost','Increases the power of bowgun special ammo and Dragon Piercer.',2),(61,'Artillery','artillery','Strengthens explosive attacks like gunlance shells, Wyvern\'s Fire, charge blade phial attacks, and sticky ammo.',3),(62,'Heavy Artillery','heavy-artillery','Increases the firepower of ballistae and cannons.',2),(63,'Marathon Runner','marathon-runner','Slows down stamina depletion for actions which continuously drain stamina (such as dashing).',3),(64,'Constitution','constitution','Reduces stamina depletion when performing stamina-draining moves such as evading, etc.',5),(65,'Leap of Faith','leap-of-faith','Allows you to do a dive-evade when facing towards large monsters, and extends the dive-evade distance.',1),(66,'Stamina Surge','stamina-surge','Speeds up stamina recovery.',3),(67,'Hunger Resistance','hunger-resistance','Reduces maximum stamina depletion over time.',3),(68,'Evade Window','evade-window','Extends the invulnerability period when evading.',5),(69,'Evade Extender','evade-extender','Increases evade distance.',3),(70,'Guard','guard','Reduces knockbacks and stamina depletion when guarding.',5),(71,'Quick Sheath','quick-sheath','Speeds up weapon sheathing.',3),(72,'Wide-Range','wide-range','Allows the effects of certain items to also affect nearby allies.',5),(73,'Item Prolonger','item-prolonger','Extends the duration of some item effects.',3),(74,'Free Meal','free-meal','Gives you a predetermined chance of consuming a food or drink item for free.',1),(75,'Speed Eating','speed-eating','Increases meat-eating and item-consumption speed.',3),(76,'Speed Sharpening','speed-sharpening','Speeds up weapon sharpening when using a whetstone.',3),(77,'Bombardier','bombardier','Increases the damage of explosive items.',3),(78,'Mushroomancer','mushroomancer','Lets you digest mushrooms that would otherwise be inedible and gain their advantageous effects.',3),(79,'Master Fisher','master-fisher','Improves your skill at fishing.',1),(80,'Pro Transporter','pro-transporter','Increases your speed while transporting items and decreases the likelihood of dropping them.',1),(81,'Master Gatherer','master-gatherer','Allows you to gather more quickly, and also prevents attacks from knocking you back while gathering.',1),(82,'Honey Hunter','honey-hunter','Increases the quantity of honey you receive when gathering in the field.',1),(83,'Carving Pro','carving-pro','Prevents knockback from attacks while carving.',1),(84,'Divine Blessing','divine-blessing','Has a predetermined chance of reducing the damage you take.',3),(85,'Palico Rally','palico-rally','Powers up Palicoes.',5),(86,'Botanist','botanist','Increases the quantity of herbs and other consumable items you gather.',4),(87,'Geologist','geologist','Increases the number of times you can use a gathering point.',3),(88,'Maximum Might','maximum-might','Increases affinity when stamina is full.',3),(89,'Slinger Capacity','slinger-capacity','Increases the loading capacity for slinger ammo obtained in the field.',3),(90,'Stealth','stealth','Makes it easier for monsters to lose sight of you.',3),(91,'Flinch Free','flinch-free','Prevents knockbacks and other reactions to small damage.',3),(92,'Scoutfly Range Up','scoutfly-range-up','Expands your scoutflies\' detection range.',1),(93,'Speed Crawler','speed-crawler','Increases movement speed while crouching.',1),(94,'Jump Master','jump-master','Prevents attacks from knocking you back during a jump.',1),(95,'Sporepuff Expert','sporepuff-expert','Recover health when using sporepuffs.',3),(96,'Aquatic Expert','aquatic-expert','Improves mobility in water.',3),(97,'Cliffhanger','cliffhanger','Decreases stamina depletion when evading while clinging to walls or ivy.',1),(98,'Blindsider','blindsider','Improves the effectiveness of flash attacks and items.',1),(99,'Scholar','scholar','Speeds up progress on research levels and special investigations. (Effect is applied at the quest results screen.)',1),(100,'Entomologist','entomologist','Decreases the chances of destroying the bodies of small insect monsters, allowing them to be carved.',3),(101,'Effluvia Resistance','effluvia-resistance','Gain a resistance to effluvial buildup.',3),(102,'Scenthound','scenthound','Increases your scoutflies\' gauge fill rate when you find tracks and other traces left by monsters.',1),(103,'Forager\'s Luck','foragers-luck','Increases the chance of finding rare gathering points.',1),(104,'Detector','detector','Shows rare gathering points on the Wildlife Map.',1),(105,'BBQ Master','bbq-master','Improves your skill at cooking meat.',1),(106,'Tool Specialist','tool-specialist','Reduces the recharge time for specialized tools.',3),(107,'Affinity Sliding','affinity-sliding','Sliding increases your affinity for a short time.',1),(108,'Intimidator','intimidator','Reduces the chances small monsters will attack after spotting you. (No effect on certain monsters.)',3),(109,'Hasten Recovery','hasten-recovery','Regenerates your health as you continually attack a monster. Recovery varies by weapon.',1),(110,'Super Recovery','super-recovery','Allows recovery to exceed the red portion of the health gauge.',1),(111,'Poison Duration Up','poison-duration-up','Extends the duration of your poison\'s effect on monsters.',1),(112,'Adrenaline','adrenaline','Temporarily reduces stamina depletion when health is at 40% or lower.',1),(113,'Stamina Cap Up','stamina-cap-up','Increases stamina cap.',1),(114,'Critical Element','critical-element','Increases elemental damage (fire, water, thunder, ice, dragon) when landing critical hits.',1),(115,'Mind\'s Eye/Ballistics','minds-eye/ballistics','Prevents attacks from being deflected. Also shortens the distance before ammo and arrows reach maximum power.',1),(116,'Bludgeoner','bludgeoner','Raises attack as your weapon loses sharpness. Also boosts ranged weapon melee attacks and odds of stunning.',1),(117,'Non-elemental Boost','non-elemental-boost','Powers up non-elemental weapons you have equipped.',1),(118,'Capture Master','capture-master','High chance of increased capture rewards. (No effect when joining mid-quest.)',1),(119,'Guard Up','guard-up','Allows you to guard against ordinarily unblockable attacks.',1),(120,'Guts','guts','Above a certain health threshold, you withstand an attack that would normally cart you (once only).',1),(121,'Master\'s Touch','masters-touch','Prevents your weapon from losing sharpness during critical hits.',1),(122,'Nullify Wind Pressure','nullify-wind-pressure','Negates all wind pressure.',1),(123,'Razor Sharp/Spare Shot','razor-sharp/spare-shot','Halves sharpness loss. For bows and bowguns, shots have a chance not to expend coatings or ammo.',1),(124,'Critical Status','critical-status','Increases abnormal status effect damage (paralysis, poison, sleep, blast) when landing critical hits.',1),(125,'Good Luck','good-luck','Good chance of increased quest rewards. (No effect when joining mid-quest.)',1),(126,'Bow Charge Plus','bow-charge-plus','Increases max bow charge level by one.',1),(127,'Punishing Draw','punishing-draw','Adds a stun effect to draw attacks and slightly increases attack power.',1),(128,'Protective Polish','protective-polish','Weapon sharpness does not decrease for a set time after sharpening.',1),(129,'Poison Functionality','poison-functionality','Allows you to apply poison coatings.',1),(130,'Para Functionality','para-functionality','Allows you to apply paralysis coatings.',1),(131,'Sleep Functionality','sleep-functionality','Allows you to apply sleep coatings.',1),(132,'Blast Functionality','blast-functionality','Allows you to apply blast coatings.',1),(133,'Elderseal Boost','elderseal-boost','Increases the Elderseal of weapons and dragon ammo.',1),(134,'Great Luck','great-luck','High chance of increased quest rewards. (No effect when joining mid-quest.)',0),(135,'Carving Master','carving-master','Lets you carve one additional time. (No effect when joining mid-quest.)',0);
